import * as React from "react";
import { useState } from "react";
import styled from "styled-components";
import axios from "axios";
import CategorieTab from "../components/CategoryTab";

interface CategorieProps {
  item: { categoryPk: number; categoryCode: string; categoryName: string };
}
const Home: React.FC = () => {
  const [categorieDB, setCategorieDB] = useState<any>("");
  const axios_GetCategorie = axios
    .get("./data/Categories.json")
    .then((data) => console.log(data));

  return (
    <Container>
      <Header>커뮤니티</Header>
      {categorieDB.map((item: CategorieProps, idx: number) => {
        <CategorieTab item={item} idx={idx} />;
      })}
    </Container>
  );
};

export default Home;

const Container = styled.div`
  display: flex;
  position: relative;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;
const Header = styled.header`
  position: absolute;
  top: 34px;
  left: 30px;
  width: 81px;
  line-height: 32px;
  height: 32px;
  font-weight: 700;
  font-size: 22px;
`;
